import '../custom.scss'
import '../css/Welcome.css';
import '../css/footer.css';
function Footer(){
    return (
        <>
            <footer>
                <div className='footer'>
                    <h1>Welcome to Rakugaki</h1>
                    <p>where you can express yourself through both words and art. Sign in to your account to share your thoughts and sketches with a community of like-minded creators. With our built-in drawing tool, you can create and post unique illustrations. With just a click you can share your artworks with friends and followers from all over the world. Join our community today and see what kind of art you can create!</p>
                </div>

            </footer>
        </>
);
}

export default Footer;
